import React from 'react';

export default function Card(props) {
    let badgeText;
    if (props.obj.quantity === 0) {
        badgeText = "SOLD OUT";
    } else if (props.obj.quantity > 0) {
        badgeText = `AVAILABLE ${props.obj.quantity}`;
    }

    // Ensure image is a string before calling replace
    const imageUrl = props.obj.image ? props.obj.image.replace(/"/g, '') : '';
    console.log('Cover Image URL:', imageUrl);

    return (
        <a href={props.obj.product_url} target="_blank" rel="noopener noreferrer" className="card">
        <div className="card" >
            <img src={imageUrl} alt="" className="card-photo" />
            {badgeText && <button className="btn">{badgeText}</button>}
            <p className="star-items">
                <img src="./Star.png" alt="" className="star-photo" />
                Users {props.obj.users}
            </p>
            <p>{props.obj.product_title}</p>
            {props.obj.price_available && <p><b>From {props.obj.currency} {props.obj.price}</b>/per person</p>}
        </div>
        </a>
    );
}
